import React, { Component } from 'react';
import './ColorPalette.css';

import {colors, defaultColor} from '../helpers/constants';

export default class ColorPalette extends React.Component {
    constructor(props) {
        super(props);
        this.state = {

        };
    }
    componentDidMount() {

    }
    componentDidUpdate() {

    }
    render() {
        const colorDivs = colors.map(color => {
            return (
                <div className='ColorPalette-color' key={color} style={{color: color}}/>
            );
        });
        const colorRows = colorDivs.filter((color, index) => index % 2 == 0).map((firsColor, index) => {
            const secondColor = colorDivs[index+1];
            return (<div className='ColorPalette-row' key={index}>
                {firsColor}
                {secondColor}
            </div>);
        });
        return (
            <div className='ColorPalette-container'>
                Colors:
                <div className='ColorPalette-column'>
                    {colorRows}
                </div>
            </div>
        );
    }
}
